description.text:
I printed it vertically at 0.3mm in PLA, and that seemed to work the best.  
I used the 1x4 keypad from adafruit (and other places)   
<a rel="nofollow" href="http://www.adafruit.com/products/1332" >http://www.adafruit.com/products/1332</a>  
And the Arduino Trinket, although like I said, I am going to switch to a mircro. It looks like the Trinket Pro would probably work better but they are currently out stock.    
<a rel="nofollow" href="http://www.adafruit.com/products/1501" >http://www.adafruit.com/products/1501</a>    
If you  do use the trinket you will also need to grab Frank Zhao's usb keyboard library for the trinket at:     
<a rel="nofollow" href="https://learn.adafruit.com/trinket-usb-keyboard/overview" >https://learn.adafruit.com/trinket-usb-keyboard/overview</a>    
You will also have to 'disable' the red LED on the trinket to stop it from screwing up the input on pin 1. I used pliers, be careful.   
Here is the code I used :  
<code >void setup()  
{  
  pinMode(0,INPUT);  
  pinMode(1,INPUT);  
  pinMode(2,INPUT);  
  digitalWrite(0, HIGH);  
  digitalWrite(1, HIGH);  
  digitalWrite(2, HIGH);  

  TrinketKeyboard.begin();  
}  
int oneHold = 0;  
int twoHold = 0;  
int threeHold = 0;  

void loop()  
{  
  TrinketKeyboard.poll();  

  if (digitalRead(0) == LOW)  
  {  
    if(oneHold==0){  
      TrinketKeyboard.pressKey(0,KEYCODE_SPACE);  
      oneHold = 1;  
    }  
  }else{  
   if(oneHold == 1){  
     TrinketKeyboard.pressKey(0,0);  
     oneHold = 0;  
   }   
  }  

  if (digitalRead(1) == LOW)  
  {  
    if(twoHold==0){  
      TrinketKeyboard.pressKey(0,KEYCODE_B);  
      twoHold = 1;  
    }  
  }else{  
   if(twoHold == 1){  
     TrinketKeyboard.pressKey(0,0);  
     twoHold = 0;  
   }   
  }  

  if (digitalRead(2) == LOW)  
  {  
    if(threeHold==0){  
      TrinketKeyboard.pressKey(0,KEYCODE_E);  
      threeHold = 1;  
    }  
  }else{  
   if(threeHold == 1){  
     TrinketKeyboard.pressKey(0,0);  
     threeHold = 0;  
   }   
 }  

}</code>

